import React, { Component } from 'react';
import Table from './table';

class Tables extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            counters: [
                {id:1, value: 0},
                {id:2, value: 0},
                {id:3, value: 0},
                {id:4, value: 0},
                {id:5, value: 0}
            ]
         }
    }
    render() { 
        return ( <div>
            {this.state.counters.map(
                counter => 
                    <Table
                        key={counter.id}
                        value={counter.value}
            />)}
        </div> );
    }
}

export default Tables;
